const App = () => {
  return (
    <div className="todo-container">
      {/* <CounterComponent/> */}
      <Header />
      <Item name="Eat"/>
      <Item completed={true} name="Sleep"/>
      <Button/>
      <Timer/>
    </div>
  );
};

export default App;
